import react from 'react'
import {Link} from 'react-router-dom'
import { css } from "styled-components/macro"

const Header= ()=>{
    return(
        <Container>
      <RouterLink
        to="/"
        css={css`
          display: flex;
          flex-direction: row;
          justify-content: center;
          align-items: center;
          color: black;
          text-decoration: none;
        `}
      >
        <LogoImage src="https://cataas.com/c" alt="logo" />
        <Title>Gallery</Title>
      </RouterLink>
      <Nav>
        <Link exact to="/">
          Home
        </Link>
        <Link exact to="/favourites">
          Favourites
        </Link>
      </Nav>
    </Container>
    )
}
export default Header
